import React, { Component } from 'react'
import './App.css';


export default class App extends Component {

  componentDidMount() {
    fetch('http://localhost:8080/product')
      .then(responce => responce.json())
      .then(data => console.log(data))
  }

  render() {
    return (
      <div>
        <h1>hui</h1>
      </div>
    )
  }
}
